import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a visible product "Add to Cart" button using text and class
    await page.waitForSelector('button.add-to-cart', { timeout: 5000 });

    // Rapidly add multiple products to cart using different selectors
    // 1. First product: by first .add-to-cart button
    const addToCartButtons = await page.$$('button.add-to-cart');
    if (addToCartButtons.length < 2) throw new Error('Not enough Add to Cart buttons found');

    // Click first Add to Cart
    await addToCartButtons[0].click();
    await page.waitForTimeout(300); // brief pause for UI update

    // Screenshot after first add
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_first_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_first_add.png'));

    // 2. Second product: by second .add-to-cart button
    await addToCartButtons[1].click();
    await page.waitForTimeout(300);

    // Screenshot after second add
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_second_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_second_add.png'));

    // 3. Third product: by XPath (find third product card's add-to-cart)
    const thirdAddToCart = await page.$('(//button[contains(@class,"add-to-cart")])[3]');
    if (thirdAddToCart) {
      await thirdAddToCart.click();
      await page.waitForTimeout(300);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_third_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_third_add.png'));

    // 4. Fourth product: by text content (if available)
    const fourthAddToCart = await page.$('//button[contains(text(),"Add to Cart")][4]');
    if (fourthAddToCart) {
      await fourthAddToCart.click();
      await page.waitForTimeout(300);
    }

    // Screenshot after fourth add
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_fourth_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_fourth_add.png'));

    // Open cart by clicking cart area (using .cart class)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Screenshot of cart modal after adds
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_cart_opened.png'));

    // Remove first item from cart (first .remove-item button)
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    const removeButtons = await page.$$('.remove-item');
    if (removeButtons.length > 0) {
      await removeButtons[0].click();
      await page.waitForTimeout(300);
    }

    // Screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_remove_first.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_remove_first.png'));

    // Increase quantity of second item (first .quantity-btn "+" after removal)
    const plusButtons = await page.$$('button.quantity-btn');
    // The "+" buttons are every second button in the .quantity-btn list (since "-" and "+" alternate)
    if (plusButtons.length >= 2) {
      await plusButtons[1].click();
      await page.waitForTimeout(300);
    }

    // Screenshot after increasing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_8_increase_quantity.png') });
    screenshots.push(path.join(screenshotsDir, 'step_8_increase_quantity.png'));

    // Extract cart item titles and quantities for verification
    const cartItems = await page.$$eval('.cart-item', items =>
      items.map(item => {
        const title = item.querySelector('.cart-item-title')?.textContent?.trim() || '';
        const quantity = item.querySelector('.quantity')?.textContent?.trim() || '';
        return { title, quantity };
      })
    );

    // Proceed to checkout if button exists
    const checkoutBtn = await page.$('button.checkout-btn');
    if (checkoutBtn) {
      await checkoutBtn.click();
      await page.waitForTimeout(500);
      await page.screenshot({ path: path.join(screenshotsDir, 'step_9_checkout.png') });
      screenshots.push(path.join(screenshotsDir, 'step_9_checkout.png'));
    }

    return {
      success: true,
      action: "Performed rapid cart manipulation: added 4 items, removed 1, increased quantity, and proceeded to checkout. Cart state extracted.",
      extractedData: {
        cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
